import numpy as np
import matplotlib.pyplot as plt
import pandas as pd
import io


def main(isoch_f):
    """ """
    # Gaia solar isochrone from PARSEC
    df = pd.read_csv(io.StringIO(isoch_f))

    m1 = df["Mini"]
    mag_m1 = df["Gmag"]
    mc1, mc2 = df["G_BPmag"], df["G_RPmag"]
    col_m1 = mc1 - mc2

    # q = 1
    m2 = m1 * 1
    mag_m2 = np.interp(m2, m1, mag_m1)
    mag_b = mag_combine(mag_m1, mag_m2)
    #
    f_m1 = np.interp(m2, m1, mc1)
    f1 = mag_combine(mc1, f_m1)
    f_m2 = np.interp(m2, m1, mc2)
    f2 = mag_combine(mc2, f_m2)
    col_b = f1 - f2

    m3 = m1 * 1
    mag_m3 = np.interp(m3, m1, mag_m1)
    mag_b3 = mag_combine(mag_b, mag_m3)
    #
    f_m1 = np.interp(m3, m1, f1)
    f1 = mag_combine(f1, f_m1)
    f_m2 = np.interp(m3, m1, f2)
    f2 = mag_combine(f2, f_m2)
    col_b3 = f1 - f2

    plt.scatter(col_m1, mag_m1, alpha=0.5, c="b")
    plt.scatter(col_b, mag_b, alpha=0.5, c="r")
    plt.scatter(col_b3, mag_b3, alpha=0.5, c="orange")
    plt.gca().invert_yaxis()
    plt.show()

    breakpoint()


def mag_combine(m1: np.ndarray, m2: np.ndarray) -> np.ndarray:
    """
    Combine two magnitudes. This is a faster re-ordering of the standard
    formula:

    -2.5 * np.log10(10 ** (-0.4 * m1) + 10 ** (-0.4 * m2))

    """
    c = 10**-0.4
    mbin = -2.5 * (-0.4 * m1 + np.log10(1.0 + c ** (m2 - m1)))
    return mbin


